import React from "react";
import "./CardItem_3.css";
import img5 from "./Rectangle_13.png"

const Img4 = () => {
    return (
        <div className="box3">
            <div className="group">
                <div className="overlap-group">
                    <img className="rectangle" alt="Rectangle" src={img5} />
                    <div className="div" />
                    <div className="hunter-x-hunter">&nbsp;&nbsp;&nbsp;&nbsp;Hunter x Hunter</div>
                </div>
            </div>
        </div>
    );
};

export default Img4;
